                  <NavLink to={"/dashboard/profile"}>profile</NavLink>
                  <NavLink to={"/dashboard/my_Appointments"}>dashboard</NavLink>
                  {/* <NavDropdown.Divider /> */}
                  {/* <MyButtonLg
                    action={() => {
                      // signOut(auth);
                      localStorage.removeItem("accessToken");
                    }}
                    className={"header-btn"}
                    style={{
                      width: "100%",
                      padding: "5px 0",
                      background: "#1f2278",
                    }}
                  >
                    {" "}
                    signOut
                  </MyButtonLg>
                </NavDropdown> */}
              {/* ) : () */}

                <MyButtonLg
                  action={() => navigate("/login")}
                  className={"header-btn"}
                  style={{
                    width: "150px",
                    padding: "7px 0",
                    background: "#e1e2f6",
                    color: "#1f2278",
                  }}
                >
                  {" "}
                  login
                </MyButtonLg>
              {/* )} */}
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </>
  );
}

export default Header;
